import styled from "styled-components";

export const Container = styled.section`
  display: flex;
  width: 100%;
  margin-bottom:40px;
  border:1px solid white;
  border-radius:25px;
  @media (min-width: 768px) {
    width:48%;
  }
`;
export const Status = styled.div`
  border: 1px solid #98e832;
  @media (min-width: 768px) {
    width: 48%;
  }
`;
